import { useEffect, useState } from "react";
import { useParams } from "react-router-dom";

function EditCategres(){
const[Data,setdata]=useState("")
const[title,settitle]=useState("")
const[Price,setprice]=useState("")
let {Id}=useParams()

useEffect(()=>{
fetch(`http://localhost:9000/Cateogiers/${Id}`)
.then(res=>res.json())
.then(data=>setdata(data))
},[])
function FormSubmit(e){
    e.preventDefault()
    

}
return(
<div>
<h1>AddProdact</h1>
<form onSubmit={FormSubmit}>
<div className="mb-3">
<label htmlFor="exampleInputEmail1" className="form-label">Title </label>
<input value={Data.title} type="text" placeholder="Prodact Title" className="form-control" id="exampleInputEmail1" aria-describedby="prodact Title" />
</div> 
<div className="mb-3">
<label htmlFor="exampleInputEmail1" className="form-label">Price </label>
<input onChange={(e)=>settitle()} value={Data.price} type="text" placeholder="Prodact Price" className="form-control" id="exampleInputEmail1" aria-describedby="prodact Title" />
</div> 
<button type="submit" className="btn btn-primary">Add</button>
</form>
</div>
)
}
export default EditCategres
